import React from 'react';

function Footer() {
    return (
    <div class="footcontainer">
`      <div class="end">
        <ul>
          <li>GitHub</li>
          <li>LinkedIn</li>
          <li>Stack Overflow</li>
          <li>Dev.to</li>
        </ul>
      </div>`
      </div>
    );
  }
  
  export default Footer;
